/*Creando la tabla Cliente*/

IF OBJECT_ID('tb_Cliente') is not null
	drop table tb_Cliente


create table tb_Cliente
(
	Id_Cliente   		          int           not null,    /*Llave primaria*/
	Pais                          varchar(50)   not null,  
	Nombre                        varchar(50)	not null,
	Apellido			          varchar(50)	not null,
	[Fecha de Nacimiento]         date          not null,
	Genero                        char(1)       not null,  
	Ingresos                      float         not null,  
	Ocupación                     varchar(200)  not null, 
)

select * from tb_Cliente

/*DEFINIENDO LA LLAVE PRIMARIA
En la tb_Cliente la llave primaria es Id_Cliente */
alter table tb_Cliente
add constraint pk_tb_Cliente primary key (Id_Cliente)   /*Llave primaria*/

/*Colocando restricciones*/
alter table tb_Cliente
add	constraint ck_tb_Cliente_Genero01 check (Genero like 'F' or Genero like 'M')

exec sp_helpconstraint tb_Cliente


/*Creando la tabla Categoria*/

IF OBJECT_ID('tb_Categoria') is not null
	drop table tb_Categoria

create table tb_Categoria
(
	Id_Categoria   		          int           not null,    /*Llave primaria*/
	Categoria                     varchar(50)   not null,    
)

select * from tb_Categoria


/*DEFINIENDO LA LLAVE PRIMARIA
En la tb_Categoría la llave primaria es Id_Categoría*/
alter table tb_Categoria
add constraint pk_tb_Categoria primary key (Id_Categoria)   /*Llave primaria*/

exec sp_helpconstraint tb_Categoria


/*Creando la tabla Producto*/

IF OBJECT_ID('tb_Producto') is not null
	drop table tb_Producto

create table tb_Producto
(
	Id_Producto		            int           not null,    /*Llave primaria*/
	Producto                    varchar(200)  not null,    
	Color		                varchar(50)	  not null,
	PrecioCatalogo              float         not null,
	Tamaño                      varchar(10)   not null,
	Modelo                      varchar(200)  not null,  
	/*Consignando las columnas de las llaves foraneas*/
	Id_Categoria                int           not null,
)

select * from tb_Producto

/*DEFINIENDO LA LLAVE PRIMARIA
En la tb_Producto la llave primaria es Id_Producto*/
alter table tb_Producto
add constraint pk_tb_Producto primary key (Id_Producto)   /*Llave primaria*/

exec sp_helpconstraint tb_Producto

/*Creando la tabla Ventas*/

IF OBJECT_ID('tb_Ventas') is not null
	drop table tb_Ventas
	

create table tb_Ventas
(
	Id_Producto			int     not null,    /*Llave foranea*/
	Id_Cliente          int     not null,    /*Llave foranea*/
	Cantidad			int     not null,
	Precio              float   not null,
	Coste               float   not null,
	Venta               float   not null,  
	[Fecha Orden]       date    not null, 
)

select * from tb_Ventas



/*CREANDO RELACIONES ENTRE TABLAS*/
/*La tb_Producto se va a relacionar con la tb_Categoría través del Id_Ctegoría*/
alter table tb_Producto
drop constraint fk_tb_Producto_tb_Categoria 

alter table tb_Producto
add constraint fk_tb_Producto_tb_Categoria  foreign key (Id_Categoria) references tb_Categoria  (Id_Categoria)

/*La tb_Ventas se va a relacionar con la tb_Cliente a través del Id_Cliente*/

alter table tb_Ventas
drop constraint fk_tb_Ventas_tb_Cliente

alter table tb_Ventas
add constraint fk_tb_Ventas_tb_Cliente foreign key (Id_Cliente) references tb_Cliente (Id_Cliente)


/*La tb_Ventas se va a relacionar con la tb_Producto a través del Id_Producto*/
alter table tb_Ventas
drop constraint fk_tb_Ventas_tb_Producto

alter table tb_Ventas
add constraint fk_tb_Ventas_tb_Producto foreign key (Id_Producto) references tb_Producto (Id_Producto)




